}};
  const columns = [
    {
      title: 'Tên nhân viên',
      dataIndex: 'username',
      key: 'name',
      width: "20%"  ,
      
    },
    {
      title: 'Tài khoản nhân viên',
      dataIndex: 'email',
      key: 'price',
      width: "20%" ,
      ellipsis:true
    },
    
    {
      title: 'Vị trí',
      dataIndex: 'role',
      key: 'description',
      width: "20%" ,
      ellipsis:true,
      
     
      
    },
    
    
    {
      title: '',
      dataIndex: 'action',
      width: '10%',
      render: (_, record) => (
        <>
          {record.name === 'initial' && <Button icon="plus" shape="circle" />}
          {record.name !== 'initial' && (
            <>
            <Button icon="search" shape="circle" style={{backgroundColor: "#008CBA" ,marginRight:"5px"}} />
            <Button icon="delete" shape="circle" type="danger" />
            </>
          )}
        </>
      )
    }

  ];
  const myColTitleStyle = {
    textOverflow: 'ellipsis',
    overflow: "hidden",
    whiteSpace: 'nowrap',
    
  };
  
  return (
    <>
    <ViewWrapper style={{filter:blur_style}}>
    <Button type="primary"  onClick={openForm} style={{ marginBottom: '3%' }}>
        Thêm nhân viên mới +
    </Button>
    <TableWrapper dataSource={service_employee.data.data} columns={columns}   />
    </ViewWrapper>
    
    </>
  );
}
